def handle_data_request(request,parms,browserAnalysis,__air_id__,__apiMap__):
    d = {}
    
    email = 'raychorn@hotmail.com'
    title = 'UNDEFINED TITLE'
    information_text = ''
    information_html = ''
    if (django_utils.is_method_post(request)):
        email = django_utils.get_from_get(request,'email',email)
        title = django_utils.get_from_get(request,'title',title)
        items = ['%s=%s'%(k,v) for k,v in request.POST.iteritems()]
    else:
        email = django_utils.get_from_post(request,'email',email)
        title = django_utils.get_from_post(request,'title',title)
        items = ['%s=%s'%(k,v) for k,v in request.GET.iteritems()]
    information_text = ','.join(items)
    information_html = '<OL>%s</OL>'%(''.join(items))
    
    _current_site_ = settings.CURRENT_SITE
    _current_site = _current_site_.replace('.appspot','').replace('.com','').capitalize()
    
    c = { 
          'site': _current_site_,
          'site_name': _current_site,
          'ssl':'s' if (settings.IS_PRODUCTION_SERVER) else '',
          'information_text': information_text,
          'information_html': information_html,
          }
    message = django_utils.render_from_string(__smithmicro_report_email__,context=c)
    message_html = django_utils.render_from_string(__smithmicro_report_email_html__,context=c)
    d[_error_symbol] = queue_email('raychorn@gmail.com',email,title,message,message_html,__air_id__,'ChartsDemo')
    json = dict_to_json(d)
    return HttpResponse(content=json,mimetype=__jsonMimetype)

def handle_json_request(request,parms,browserAnalysis,__air_id__,__apiMap__):
    from geotaggerhook import geotagger, NUM_SMALL_BOXES, _keys_, _AS_DICT
    from vyperlogix.classes.SmartObject import SmartFuzzyObject

    d = {}

    json = __smithmicro_sample_json__
    d = json_to_python(json)

    def get_data_for(name,num_records=25,_start_lat=37.0,_start_lng=-122,_num_lat=1,_num_lng=1):
        import random
        
        def reshape_record_as_list(d,keys):
            l = []
            for k in keys:
                l.append(d[k] if d.has_key(k) else -1)
            return l
        
        record_choices = []
        _i_ = 0
        _id_ = 0
        _data_node_name = name
        random.seed()
        scale_factors = xrange(2,10)
        random_choice = lambda x:random.randrange(0,x*10,1)/random.choice(scale_factors)
        records = []
        _step = 1.0/NUM_SMALL_BOXES
        _lat = lat = _start_lat
        _lng = _start_lng
        while (lat < _lat+_num_lat):
            lng = _start_lng
            while (lng > _lng-_num_lng):
                g = SmartFuzzyObject(geotagger(lat,lng,_as_=_AS_DICT))
                record = reshape_record_as_list(g,_keys_)
                record.append(random_choice(100))
                record_choices.append(record)
                _id_ += 1
                lng -= _step
                _i_ += 1
            lat += _step
        for n in xrange(0,num_records):
            records.append(random.choice(record_choices))
        return records
    
    if (len(d) == 0):
        _col_name = 'peak_speed'
        d['columns'] = misc.clone(_keys_)+[_col_name]
        d['results'] = get_data_for(_col_name)
    
    json = dict_to_json(d)
    return HttpResponse(content=json,mimetype=__jsonMimetype)

